import Meta from "./Meta";
import Header from "./Header";
import Footer from "./Footer";

const Layout = props => (
  <>
    <Meta />
    <Header />
    <main>
      {props.children}
      <Footer />
    </main>
    <style jsx>{`
      main {
        flex: 1;
      }
    `}</style>
  </>
);

export default Layout;
